import{_ as e,W as c,X as o,a0 as d}from"./framework-0a321081.js";const l={},i=d('<h1 id="搜索引擎高级搜索指令" tabindex="-1"><a class="header-anchor" href="#搜索引擎高级搜索指令" aria-hidden="true">#</a> 搜索引擎高级搜索指令</h1><p>通常我们搜索的东西都是一些重复甚至垃圾内容，当我们需要精确的搜索可以在搜索引擎中使用一些关键字参数</p><ul><li><code>&quot;搜索内容&quot;</code>双引号包含精确搜索</li><li>排除搜索 <code>搜索内容 - 排除的内容</code></li><li>标题搜索 <code>搜索内容 intitle:内容</code>即搜索结果中的标题必须包含你指定的内容或使用<code>allintitle:关键字1 关键字2 ...</code></li><li>站内搜索 <code>搜索内容 site:指定网站域名</code></li><li>指定搜索的文件类型 <code>搜索内容 :filetype</code>,如<code>:pdf</code></li><li>模糊匹配 <code>搜索*内容</code></li><li>指定url中的内容 <code>搜索内容 inurl:edu.cn</code>或者<code>allinurl:edu.cn baidu.com</code>指定多个</li></ul><p>以上指令兼容主流搜索引擎如谷歌和百度</p>',4),t=[i];function _(a,n){return c(),o("div",null,t)}const s=e(l,[["render",_],["__file","搜索引擎高级搜索指令 .html.vue"]]);export{s as default};
